import React from "react";
import Todo from "./components/Todo";

const todos = ["Buy milk", "Pay rent", "Go to the bank"];

export default function App() {
  return (
    <ul>
      {todos.map((todo, i) => (
        <Todo key={i}>{todo}</Todo>
      ))}
    </ul>
  );
}
